import React from "react";
import PropTypes from 'prop-types';

function Card({ nombre, imagen }) {
  const imagePath = require(`../assets/${imagen}`);

  return (
    <div className="card text-center bg-dark animate__animated animate__fadeInUp">
      <div className="overflow">
        <img src={imagePath.default} alt="a wallpaper" className="card-img-top rounded" />
      </div>
      <div className="card-body text-light">
        <h4 className="card-title">{nombre}</h4>
        <p className="card-text text-secondary">
          Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el
          texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se
          dedica a la imprenta)
        </p>
        <a href="https://example.com" className="btn btn-outline-secondary border-0 btn-sm">
          Go to this website
        </a>
      </div>
    </div>
  );
}

Card.propTypes = {
  nombre: PropTypes.string.isRequired,
  imagen: PropTypes.string
};

export default Card;
